import React from 'react';
import {
  Container, 
  ImageProduct, 
  PaymentBox,
  InfosProduct,
  InfoLeft,
  CartTotal
} from './styles';

function CheckoutDesktop(props) {
  const { product } = props
  return (
    <Container>
      <ImageProduct>
        <img src={product.MaxresURL} alt="Product" />
      </ImageProduct>
      <PaymentBox>
        <InfosProduct>
          <InfoLeft>
              <CartTotal>Cart total</CartTotal>
              <p>{product.description}</p>
              <p>
                x 1, {product.color}, Size {product.size}
              </p>
              <p>Item #{product.id}</p>
          </InfoLeft>
        </InfosProduct>
      </PaymentBox>
    </Container>
  );
};

export default CheckoutDesktop;
